import { Injectable } from '@angular/core';
import { INumberEqualCondition, INumberEqualService } from '../Services.Abstractions/INumberEqualService';

@Injectable()
export class NumberEqualServiceService implements INumberEqualService{

  constructor(private _conditions: INumberEqualCondition[]) { }

  public IsEqual(number: number): boolean {

    for (const condition of this._conditions) {
      if (!condition.IsEqual(number)) {
        return false;
      }
    }

    return true;

    return true;
  }
}
